import styled from 'styled-components'

const StyledWrapper = styled.div`
  display: block;
  position: absolute;
  width: 400px;
  height: 400px;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  z-index: 10;
  background: #555;
`

export default StyledWrapper
